import "../App.css";

const DetailPage = () => {
  return (
    <div className="container">
      <div className="row">
        <div className="col-md-6"></div>
        <div className="col-md-6">
          <h4 className="pt-5">제목</h4>
          <p>id</p>
          <p>내용</p>
          <Link to="/">
            <button className="closeDetail">닫기</button>
          </Link>
        </div>
      </div>
    </div>
  );
};

export default DetailPage;
